import React from 'react';
import { Container, Card, Col, Image } from 'react-bootstrap';


const Home:React.FC = () => {
    return (
     <Container>
     <Card
          style={{ width: '18rem',border:'none' }}
          className="mt-5 text-center"
        >
          <Card.Body>
            <Card.Title> Hello </Card.Title>
            <Card.Text>
              I am Ionut Ciornei
            </Card.Text>
          </Card.Body>
          </Card>
          <Col xs={6} md={4} style={{position:'absolute', right:'50%', top:'70px'}}>
          <Image src="/img/me.jpg" alt='me' style={{borderRadius:'50%'}} />
        </Col> 
     </Container>      
    )
};

export default Home;
